import { GameFactory } from "../src";
import { sortingReplacer, reviver } from "../src/common";
const safeString = require('safe-stable-stringify');

const _states = [realm, acity, volcano, crossway, manalath, homeworlds, cannon, amazons, fendo, urbino, tintas, blam, strings, stringsResign, stringsTimeout, stringsDraw, pigs, streetcar, entropy, armadas, mvolcano, witch];
_states.map(a => {});
const states = [urbino];

for (const state of states) {
    const parsed = JSON.parse(state, reviver) as {game: string; [k:string]: any};
    const newgame = GameFactory(parsed.game, state);
    if (newgame === undefined) {
        throw new Error(`Cannot create ${parsed.game} game`);
    }
    const scratchState = newgame.state();
    if (parsed.game === "entropy") {
        scratchState.stack = scratchState.stack.map(s => { delete s.bag; return s; });
    }
    let newstate = safeString(scratchState, sortingReplacer);
    if (parsed.game === "homeworlds") {
        newstate = newstate.toLowerCase();
    }
    // const newstring = newgame.serialize();
    // if (newstring.includes("startpos")) {
    //     console.log(newstring, "\n");
    // }
    const newnewgame = GameFactory(parsed.game, newgame.serialize());
    if (newnewgame === undefined) {
        throw new Error(`Cannot create the second ${parsed.game} game`);
    }
    const newScratchState = newnewgame.state();
    if (parsed.game === "entropy") {
        newScratchState.stack = newScratchState.stack.map(s => { delete s.bag; return s; });
    }
    let newnewstate = safeString(newScratchState, sortingReplacer);
    if (parsed.game === "homeworlds") {
        newnewstate = newnewstate.toLowerCase();
    }
    if (newstate !== newnewstate) {
        console.log(`Mismatch: ${parsed.game}`);
        console.log(`Original:\n${newstate}`);
        console.log(`New:\n${newnewstate}`);
        break;
    }
}
